INSERT INTO `specialties` (`id`, `image`, `name`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(3, , 'Cơ Xương Khớp', '<p>List of leading musculoskeletal doctors in Vietnam:</p>\n<p>Experts with comprehensive training and extensive experience.\nProfessors and associate professors currently conducting research and teaching at Hanoi Medical University.\nDoctors who have worked or are currently working at top hospitals in the Musculoskeletal Department such as Bach Mai Hospital, Viet Duc Friendship Hospital, and E Hospital.\nMembers or leaders of professional organizations such as the Musculoskeletal Association, Rheumatology Association, etc.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor, etc.\nMusculoskeletal Diseases:</p>\n<p>Gout\nOsteoarthritis: knee joints, lumbar spine, cervical spine\nRheumatoid arthritis, polyarthritis, tendonitis\nJoint effusion: knee joint, hip joint, elbow joint, shoulder joint\nOsteoporosis, bone pain\nOsteitis, bone spurs\nMyositis, muscle atrophy, muscle pain and fatigue</p>\n', 'List of leading musculoskeletal doctors in Vietnam:\n\nExperts with comprehensive training and extensive experience.\nProfessors and associate professors currently conducting research and teaching at Hanoi Medical University.\nDoctors who have worked or are currently working at top hospitals in the Musculoskeletal Department such as Bach Mai Hospital, Viet Duc Friendship Hospital, and E Hospital.\nMembers or leaders of professional organizations such as the Musculoskeletal Association, Rheumatology Association, etc.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor, etc.\nMusculoskeletal Diseases:\n\nGout\nOsteoarthritis: knee joints, lumbar spine, cervical spine\nRheumatoid arthritis, polyarthritis, tendonitis\nJoint effusion: knee joint, hip joint, elbow joint, shoulder joint\nOsteoporosis, bone pain\nOsteitis, bone spurs\nMyositis, muscle atrophy, muscle pain and fatigue', '2024-08-30 22:45:38', '2024-08-30 22:45:38');
INSERT INTO `specialties` (`id`, `image`, `name`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(4, , 'Thần Kinh', '<p>List of leading professors and neurology specialists:</p>\n<p>Renowned professors and doctors in the neurology field who have worked or are currently working at major hospitals such as Bach Mai Hospital, Viet Duc Hospital, 108 Military Central Hospital, Hanoi Medical University Hospital, and 103 Hospital.\nMembers or leaders of professional organizations such as the Vietnam Neurology Association, the Neurosurgery Association, etc.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor.\nNeurology Specialization:</p>\n<p>Cerebral Palsy\nHeadaches, dizziness, nausea\nParkinson\'s disease, vestibular disorders\nMuscle spasms, nerve tension\nEpilepsy, loss of consciousness episodes\nFacial numbness, nerve compression</p>\n', 'List of leading professors and neurology specialists:\n\nRenowned professors and doctors in the neurology field who have worked or are currently working at major hospitals such as Bach Mai Hospital, Viet Duc Hospital, 108 Military Central Hospital, Hanoi Medical University Hospital, and 103 Hospital.\nMembers or leaders of professional organizations such as the Vietnam Neurology Association, the Neurosurgery Association, etc.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor.\nNeurology Specialization:\n\nCerebral Palsy\nHeadaches, dizziness, nausea\nParkinson\'s disease, vestibular disorders\nMuscle spasms, nerve tension\nEpilepsy, loss of consciousness episodes\nFacial numbness, nerve compression', '2024-08-30 22:47:03', '2024-08-30 22:47:03');
INSERT INTO `specialties` (`id`, `image`, `name`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(5, , 'Tiêu Hóa', '<p>List of Leading Gastroenterology Doctors in Vietnam:\nExperts with comprehensive training and extensive experience in gastroenterology, having worked at major hospitals in Hanoi.\nProfessors and associate professors who are lecturers at Hanoi Medical University.\nDoctors who have worked or are currently working at top hospitals such as Bach Mai Hospital, Viet Duc Hospital, National Children\'s Hospital, Vietnam Traditional Medicine Hospital, and others.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor.\nConsultation, Examination, and Treatment of Gastrointestinal Diseases:</p>\n<p>Poor appetite, lack of taste\nDigestive disorders, constipation, hemorrhoids\nHelicobacter pylori (HP) infection\nEndoscopy of the stomach, colon, and digestive tract\nNausea, bloating, indigestion, acid reflux, flatulence</p>\n', 'List of Leading Gastroenterology Doctors in Vietnam:\nExperts with comprehensive training and extensive experience in gastroenterology, having worked at major hospitals in Hanoi.\nProfessors and associate professors who are lecturers at Hanoi Medical University.\nDoctors who have worked or are currently working at top hospitals such as Bach Mai Hospital, Viet Duc Hospital, National Children\'s Hospital, Vietnam Traditional Medicine Hospital, and others.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor.\nConsultation, Examination, and Treatment of Gastrointestinal Diseases:\n\nPoor appetite, lack of taste\nDigestive disorders, constipation, hemorrhoids\nHelicobacter pylori (HP) infection\nEndoscopy of the stomach, colon, and digestive tract\nNausea, bloating, indigestion, acid reflux, flatulence', '2024-08-30 22:47:55', '2024-08-30 22:47:55');
INSERT INTO `specialties` (`id`, `image`, `name`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(6, , 'Tim Mạch', '<p>Bác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nKhám tư vấn tim mạch</p>\n<p>Khó thở, Đau ngực, đau tim\nTăng huyết áp, hạ huyết áp\nRối loạn mỡ máu, cao huyết áp, chóng mặt\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\nCảm giác hồi hộp, tim đập nhanh</p>\n', 'Bác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\nKhám tư vấn tim mạch\n\nKhó thở, Đau ngực, đau tim\nTăng huyết áp, hạ huyết áp\nRối loạn mỡ máu, cao huyết áp, chóng mặt\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\nCảm giác hồi hộp, tim đập nhanh	   ', '2024-08-30 22:48:20', '2024-08-30 22:48:20');
INSERT INTO `specialties` (`id`, `image`, `name`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(7, , 'Tai Mũi Họng', '<p>List of Leading ENT (Ear, Nose, and Throat) Doctors in Vietnam:\nExperts with comprehensive training and extensive experience in the ENT specialty, having worked at major hospitals in Hanoi.\nProfessors and associate professors who are lecturers at Hanoi Medical University.\nDoctors who have worked or are currently working at top hospitals such as Bach Mai Hospital, National ENT Hospital, and 108 Military Central Hospital.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor.\nENT Diseases:</p>\n<p>Tinnitus, ear pain, ear bleeding\nPerforated eardrum, sudden deafness\nOtitis media (middle ear infection)\nTonsillitis, adenoiditis\nSinusitis\nNasal congestion</p>\n', 'List of Leading ENT (Ear, Nose, and Throat) Doctors in Vietnam:\nExperts with comprehensive training and extensive experience in the ENT specialty, having worked at major hospitals in Hanoi.\nProfessors and associate professors who are lecturers at Hanoi Medical University.\nDoctors who have worked or are currently working at top hospitals such as Bach Mai Hospital, National ENT Hospital, and 108 Military Central Hospital.\nRecognized by the state with titles such as People\'s Doctor, Distinguished Doctor, Senior Doctor.\nENT Diseases:\n\nTinnitus, ear pain, ear bleeding\nPerforated eardrum, sudden deafness\nOtitis media (middle ear infection)\nTonsillitis, adenoiditis\nSinusitis\nNasal congestion', '2024-08-30 22:49:19', '2024-08-30 22:49:19');
